    "2015-10-06T20:23:11.719346",nt"name": "u-s-federal-mapping-coordination",nt"isopen":
    false,nt"url": null,nt"notes": "The Sandy Emergency Supplemental appropriations
    contained funds for federal and state agencies that will go to ocean and coastal
    mapping data acquisition. These data are needed for a variety of reasons - marine
    debris identification and removal, beach renourishment, engineering and repair decisions,
    habitat change assessments, nautical chart updates, inundation modeling, strengthening
    for future storms and coastal resilience... The list goes on, but the common thread
    is the need for OCM data to support decision-making. As the Integrated Working Group
    on Ocean and Coastal Mapping, NOAA and its collaborating federal mapping agencies
    are collecting information on requirements and plans of Federal and state agencies
    for areas impacted by Hurricane Sandy. The goal is to ensure that the emergency
    supplemental funding is used to "map once, use many times." The kinds of activities
    we'd like to include in this Sea Sketch project are requirements AND plans in the
    Sandy-impacted region for: hydrographic surveys (side scan/single/multibeam); topographic,
    bathymetric, and topobathy lidar; digital imagery; hyperspectral, etc.",nt"license_title":
